INSERT INTO `sys_page` VALUES (5,NULL,'Il B&B',NULL,'','<p>In una splendita villa immersa nel verde a circa 15 minuti dall&rsquo;Aquila, il Bed &amp; Breakfast La Vecchia Posta &egrave; lieto di ospitarvi in camere con servizi privati e tv. E&rsquo; a vostra disposizione l&rsquo;ampio spazio verde di propriet&agrave; e un parcheggio riservato. Per i pasti vi consigliamo di assaggiare le offerte culinarie del ristorante la monachina, a circa 10km dal B&amp;B, oppure se vi trovate a L&rsquo;Aquila vi consigliamo le fregnacce del ristorante la rupe. Il B&amp;B vi offre inoltre la possibilit&agrave; di noleggiare gratuitamente mountainbike disponibili nella struttura e a vostra completa disposizione. Se desiderate fare passeggiate a cavallo vi indichiamo due maneggi nelle vicinanze: Shenandoah Ranch Western Riding Centro Ippico Saint Just Su richiesta &egrave; fruibile il servizio di lavanderia e trasporto da e verso la stazione dei treni e il terminal dei bus. Ti aspettiamo al Bed &amp; Breakfast La Vecchia Posta, prenota ora la tua vacanza da noiss</p>',0,'',0,0,4),(6,'admin','Alcuni servizi offerti del B&B',NULL,'','<ul class=\"list3\">\r\n<li>Parcheggio privato</li>\r\n<li>Servizio sveglia e Colazione in stanza</li>\r\n<li>Riassetto giornaliero stanza</li>\r\n<li>Animali domestici ammessi</li>\r\n<li>Parco di propriet&agrave;</li>\r\n<li>Kit di benvenuto</li>\r\n<li>Biciclette a disposizione</li>\r\n<li>TV in camera</li>\r\n<li>Internet WiFi</li>\r\n</ul>',0,'',0,0,0);
/*!40000 ALTER TABLE `sys_page` ENABLE KEYS */;
UNLOCK TABLES;

