INSERT INTO `vp_attivita` VALUES (1,'<p><span>Lunga circa 300 km &egrave; un circuito di sentieri e viottoli, percorsi da secoli, che circonda il massiccio del Gran Sasso.</span></p>\r\n<p>&nbsp;</p>\r\n<p>Permette di galoppare nella rigogliosa natura del parco nazionale del Gran Sasso e Monti della Laga e raggiungere antichi borghi vissuti da contadini e pastori.<br />Lungo tutto il percorso si possono trovare aree di sosta attrezzate per far riposare i cavalli e i fantini.</p>','Ippovia del Gran Sasso','2013-09-24 13:09:38','Parco Nazionale del Gran Sasso e Monti della Laga','<ul>\r\n<li>test</li>\r\n<li>test</li>\r\n<li>test</li>\r\n</ul>'),(2,'<p>Partenza da Cagnano Amiterno, percorrendo verso L&rsquo;Aquila la SP30a fino al bivio per Arischia. Seguendo le indicazioni per il&nbsp;<a title=\"Lago di Campotosto\" href=\"http://www.vecchiaposta.it/dintorni/lago_campotosto/\"><strong>Lago di Campotosto</strong></a>, si prosegue lungo i tornanti della S.S.80 fino ad arrivare al&nbsp;<strong>passo delle Capannelle</strong>&nbsp;a quota 1300 m s.l.m.. Proseguire verso il lago e tirare dritto fino ad Amatrice, apprezzando la natura che vi circonda.</p>\r\n<p>Ad&nbsp;<a title=\"Amatrice\" href=\"http://www.vecchiaposta.it/dintorni/amatrice/\"><strong>Amatrice</strong></a>&nbsp;sosta pranzo, e poi di nuovo in sella per domare le curve della S.R.260 che ci porta fino a Montereale, antico insediamento romano. Da Montereale si prosegue per altri 10 Km e si arriva al B&amp;B&hellip;</p>','Lago di Campotosto','2013-09-24 13:10:33','Lago di Campotosto, Macioni, L\'Aquila','<ul>\r\n<li>test</li>\r\n<li>test</li>\r\n<li>test</li>\r\n</ul>'),(3,'<p>Partendo da Cagnano Amiterno si prosegue per Montereale, antico insediamento romanico da non perdere la &rdquo;&nbsp;<em>Chiesa di Santa Maria in Assunta</em>&nbsp;&rdquo; del 1400. Dopo un rapido giro nel paesino della<em>Comunit&agrave; montana Amiternina</em>&nbsp;ci si dirige verso il&nbsp;<strong>Passo delle Capannelle</strong>, a 1300 metri s.l.m., lungo la Via Capannelle<em>,&nbsp;</em>chiusa per neve per quasi 5 mesi l&rsquo;anno , tagliando Capitignano, fino ad immettersi nella S.S.80.</p>\r\n<p>Si domano i tornanti montuosi della S.S.80 fino al bivio per Assergi, dove si imbocca la S.P.86 che taglia trasfersalmente il&nbsp;<a title=\"Parco Nazionale del Gran Sasso\" href=\"http://www.vecchiaposta.it/dintorni/parco_nazionale_gran_sasso/\"><strong>Parco Nazionale del Gran Sasso</strong></a>&nbsp;consentendo un vista mozzafiato. Giunti in vetta si possono vedere all&rsquo;orizzonte tutte le cime della catena montuosa del Gran Sasso.</p>\r\n<p>Scendendo verso valle non &egrave; difficile imbattersi in greggi di pecore, cavalli selvatici e mucche al pascolo. Percorrendo circa 20 km di tornanti si arriva alla base della funivia del Gran Sasso dove &egrave; doverso sedersi e assaporare i deliziosi arrosticini accompagnati da una gustosa e fresca bevanda.</p>\r\n<p>L&rsquo;itinerario continua lungo la S.R.17 bis direzione&nbsp;<a title=\"Impianti sciistici di Campo Imperatore\" href=\"http://www.vecchiaposta.it/dintorni/campo_imperatore/\"><strong>Campo Imperatore</strong></a>. Qui curva dopo curva si arriva fino a 2000 metri s.l.m.. Da vedere l&rsquo;albergo Hotel Campo Imperatore dove fu fatto prigioniero Benito Mussolini.</p>\r\n<p>L&rsquo;itinerario ripercorre la S.R.17 bis in direzione&nbsp;<a title=\"L&rsquo;Aquila\" href=\"http://www.vecchiaposta.it/dintorni/laquila/\"><strong>L&rsquo;Aquila</strong></a>&nbsp;e giunti a valle si visita il borgo di Paganica e Tempera. Si arriva al centro dell&rsquo;Aquila domando le famose &ldquo;curve di Tempera&rdquo;, lunghe le quali si svolge una volta all&rsquo;anno la crono scalata.</p>\r\n<p>Da non perdere nel centro storico dell&rsquo;Aquila il Forte Spagnolo, la Piazza del Duomo, la Basilica di Collemaggio e la Fontana delle 99 cannelle.</p>\r\n<p>Si torna al B&amp;B percorrendo la S.S.80 direzione Cagnano Amiterno, giunti al B&amp;B troverete un gustoso aperitivo offerto da noi.</p>','Da Cagnano al Gran Sasso','2013-09-24 13:11:24','Cagnano Amiterno','<ul>\r\n<li>test</li>\r\n<li>test</li>\r\n<li>test</li>\r\n</ul>');
/*!40000 ALTER TABLE `vp_attivita` ENABLE KEYS */;
UNLOCK TABLES;

