INSERT INTO `vp_dintorni` VALUES (1,'<p>Intorno la 1250 i feudatari della&nbsp;<strong>Valle Aterno</strong>&nbsp;chiesero l&rsquo;appoggio del Papa per fondare una citt&agrave; fortificata per liberarsi dall&rsquo;egemonia di Federico II.</p>\r\n<p>Il nome Aquila deriva probabilmente da Acquili castello del territorio dove fu fondata la citt&agrave;. Distrutta nel 1254 e successivamente ricostruita per volont&agrave; del re Carlo d&rsquo;Angi&ograve;. La ricostruzione permise di suddividere la citt&agrave; in 4 quarti, per tener conto della provenienza degli abitanti. Il quarto di San Giovanni ospit&ograve; gli abitanti provenienti da Amiterno. Le cinte murarie della citt&agrave; risalgono al 1316 quando divenne una vera e propria citt&agrave; incastellata.</p>\r\n<p>Lungo il fiume Aterno fu costruito il monumento della&nbsp;<strong>Fontana delle 99 cannelle</strong>, che inizialmente aveva soltanto 15 mascheroni raffiguranti uomini e donne, forse a simboleggiare i signori del circondario. Nell&rsquo; ultimo intervento nel 1871 il numero delle cannelle fu portato a 99 in ricordo dei castelli che fondarono la citt&agrave; costruendovi 99 chiese, 99 piazze e 99 fontana.</p>\r\n<p>Durante la dominazione spagnola nell&rsquo;Italia meridionale, nella seconda met&agrave; del 1500 fu costruito nel cuore della citt&agrave; il castello&nbsp;<strong>Forte Spagnolo</strong>&nbsp;per accrescere la potenza militare spagnola nel territorio. Mai utilizzato per scopi bellici fu sede sia del governatore spagnola, sia nella seconda guerra mondiale delle truppe tedesche. Ad oggi &egrave; sede del museo nazionale d&rsquo;abruzzo, il pi&ugrave; importante in regione.</p>\r\n<p>La citt&agrave; si &egrave; sviluppata nella conca del fiume aterno ad 721 metri di altitudine. Il paesaggio &egrave; caratterizzato dalle catene montuose degli Appennini e dal Velino Sirente. Ad oggi la citt&agrave; &egrave; capoluogo di Regione e Provincia.</p>\r\n<p>Ferita dal terremoto del 2009, la citt&agrave; cerca di tornare al suo antico splendore.<br />Sono stati restituiti ai cittadini alcuni monumenti simbolo, come la fontana delle 99 cannelle; il centro storico &egrave; tornato ad essere il centro del divertimento notturno con l&rsquo;apertura di diversi locali nella piazzetta &ldquo;del boss&rdquo;.</p>','L\'Aquila','42.354485','13.399147'),(2,'<p>L&rsquo;aspetto attuale di Amatrice risale direttamente alla pianta regolare del 1529 attribuita tradizionalmente a Nicola Filotesio, detto Cola dell&rsquo;Amatrice. Nel tessuto urbano spiccano la Torre civica risalente al&nbsp; 1200 e le severe&nbsp;<strong>torri campanarie&nbsp;</strong>della<strong>chiesa di Sant&rsquo;Agostino</strong>, caratterizzata da un bellissimo portale tardo gotico e dalla presenza di pregevoli affreschi. Degne di nota sono pure la chiesa di San Francesco caratterizzata da un portale di marmo e contenente nell&rsquo;abside affreschi del 1200, e quella di Santa Maria di Porta Ferrata. Da visitare anche il Museo Civico di arte sacra &ldquo;Nicola Filotesio&rdquo; ospitato nella chiesa di Sant&rsquo;Emidio.</p>\r\n<p>Nell&rsquo;<strong>ultimo week-end&nbsp;</strong>di&nbsp;<strong>agosto</strong>&nbsp;la citta si popola di visitatori giunti per partecipare alla<strong>&nbsp;Sagra degli Spaghetti all&rsquo;Amatriciana</strong>, giunta alla 44&deg; edizione.</p>','Amatrice','42.628749','13.292034'),(3,'<p>Il&nbsp;<strong>lago di Campotosto</strong>&nbsp;&egrave; il pi&ugrave; grande&nbsp;<a title=\"Lago artificiale\" href=\"http://it.wikipedia.org/wiki/Lago_artificiale\">lago artificiale</a>&nbsp;dell\'<a title=\"Abruzzo\" href=\"http://it.wikipedia.org/wiki/Abruzzo\">Abruzzo</a>. &Egrave; situato interamente in&nbsp;<a title=\"Provincia dell\'Aquila\" href=\"http://it.wikipedia.org/wiki/Provincia_dell%27Aquila\">provincia dell\'Aquila</a>, tra i comuni di<a title=\"Campotosto\" href=\"http://it.wikipedia.org/wiki/Campotosto\">Campotosto</a>&nbsp;(da cui prende il nome),&nbsp;<a title=\"Capitignano\" href=\"http://it.wikipedia.org/wiki/Capitignano\">Capitignano</a>&nbsp;e&nbsp;<a title=\"L\'Aquila\" href=\"http://it.wikipedia.org/wiki/L%27Aquila\">L\'Aquila</a>, ad un\'<a title=\"Altitudine\" href=\"http://it.wikipedia.org/wiki/Altitudine\">altitudine</a>&nbsp;di 1.313&nbsp;<a class=\"mw-redirect\" title=\"M s.l.m.\" href=\"http://it.wikipedia.org/wiki/M_s.l.m.\">m s.l.m.</a>. Presenta una superficie di 1400&nbsp;<a title=\"Ettaro\" href=\"http://it.wikipedia.org/wiki/Ettaro\">ettari</a>&nbsp;e raggiunge una&nbsp;<a title=\"Profondit&agrave; (liquidi)\" href=\"http://it.wikipedia.org/wiki/Profondit%C3%A0_(liquidi)\">profondit&agrave;</a>&nbsp;massima di 30-35 metri<sup id=\"cite_ref-Comune_1-0\" class=\"reference\"><a href=\"http://it.wikipedia.org/wiki/Lago_di_Campotosto#cite_note-Comune-1\">[1]</a></sup>.</p>\r\n<p>Il lago fa parte della&nbsp;<a class=\"mw-redirect\" title=\"Elenco delle riserve naturali statali italiane\" href=\"http://it.wikipedia.org/wiki/Elenco_delle_riserve_naturali_statali_italiane\">riserva naturale statale</a>&nbsp;<a title=\"Riserva naturale del Lago di Campotosto\" href=\"http://it.wikipedia.org/wiki/Riserva_naturale_del_Lago_di_Campotosto\">omonima</a>, istituita su una superficie di 1.600 ettari nel&nbsp;<a title=\"1984\" href=\"http://it.wikipedia.org/wiki/1984\">1984</a>&nbsp;a tutela dell\'ambiente naturale e del&nbsp;<a class=\"mw-redirect\" title=\"Parco Nazionale del Gran Sasso e Monti della Laga\" href=\"http://it.wikipedia.org/wiki/Parco_Nazionale_del_Gran_Sasso_e_Monti_della_Laga\">Parco Nazionale del Gran Sasso e Monti della Laga</a>.</p>','Lago di Campotosto','42.5312','13.379948');
