INSERT INTO `vp_eventi` VALUES (1,'<p>Da quasi 720 anni il&nbsp;<strong>28 di agosto</strong>&nbsp;si celebra la Perdonanza Celestiniana.</p>\r\n<p>Il corteo della bolla, composto da quasi 1000 comparse in abiti medievali raffiguranti i quattro quarti della citt&agrave;, accompagna solennemente la&nbsp;<strong>bolla del perdono</strong>, donata dal Papa Celestino V, da Palazzo di Margherita d&rsquo;Austria, sede attuale del Comune, fino alla Basilica di Santa Maria di Collemaggio. Rito comune &egrave; entrare nella Porta Santa della basilica per ricevere l&rsquo;indulgenza.</p>\r\n<p>Per volont&agrave; del Papa Celestino V fu costruita la Basilica Santa Maria di Collemaggio, caratterizzata da uno spendido e particolare rosone e dalla&nbsp;<strong>Porta Santa</strong>, aperta un volta l&rsquo;anno, in occasione della Perdonanza. Nel 1295 Pietro da Morrone fu consacrato Papa proprio nella Basilica.</p>\r\n<p>La&nbsp;<strong>settimana della Perdonanza</strong>&nbsp;&egrave; inaugurata dalla solenne accensione del braciere del morrone, sulla torre del palazzo cittadino e da un suggestivo gioco di fuochi pirotecnici. Durante la settimana nella citt&agrave; eventi ecclesiastici si alternano a spettacoli musicale e culturali. Le notti i pi&ugrave; giovani possono ballare sotto le stelle grazie a concerti gratuiti.<br />Per maggiori informazioni sull&rsquo;evento:&nbsp;<a href=\"http://www.perdonanza-celestiniana.it/\">perdonanza-celestiniana.it</a>,<br />oppure il sito del&nbsp;<a href=\"http://www.comune.laquila.gov.it/pagina27_la-perdonanza-celestiniana.html\">comune.laquila.gov.it</a></p>','Perdonanza Celestiniana','2014-08-22 22:00:00','L\'Aquila','<ul>\r\n<li>Messa dell\'apertura della porta santa</li>\r\n<li>Concerti gratuiti</li>\r\n</ul>'),(2,'<p><span>Il tour del &ldquo;cioccolato artigianale&rdquo; raggiunger&agrave; la citt&agrave; dell&rsquo;Aquila collocandosi nel cuore sua della centralissima Piazza Duomo da sabato 28 Aprile a marted&igrave; 1&deg; Maggio 2012.</span><br /><span>L&rsquo;iniziativa &egrave; patrocinata dal Comune dell&rsquo;Aquila Assessorato alle Politiche Culturali.</span><br /><span>Negli eleganti allestimenti immersi nella storica cornice della Piazza che neanche le peggiori calamit&agrave; potranno mai cambiarne l&rsquo;identit&agrave;, parteciperanno un pool di aziende leader del cioccolato artigianale provenienti da diverse parti d&rsquo;Italia. I maestri cioccolatieri presenteranno al grande pubblico la storia di questo prodotto ponendo in luce tutte le propriet&agrave; terapeutiche (come ad esempio la teobromina in esso contenuta) e le peculiarit&agrave; di questo alimento derivato dai semi della pianta del cacao definito fin dai tempi dei Maya &ldquo;Tehobroma Cacao&rdquo; ovvero &ldquo;il nettare degli dei&rdquo; e sono assai note le propriet&agrave; curative del cioccolato artigianale: &ldquo; benefici del cioccolato contro il diabete e l&rsquo;ipertensione &rdquo;.</span><br /><span>La novit&agrave; di questo &ldquo;dolce evento&rdquo; costituir&agrave; l&rsquo;occasione per spiegare al grande pubblico la differenza tra il cioccolato artigianale, in particolare quello italiano giudicato il migliore in Europa, e quello prodotto industrialmente. I visitatori potranno giudicare la squisitezza di questo alimento allo stato puro e delle svariate ricette proposte dai maestri cioccolatieri presenti.</span><br /><span>La Festa del Cioccolato, per l&rsquo;occasione chiamata &ldquo;dell&rsquo;Aquila&rdquo;, sar&agrave; un momento di allegria e spensieratezza, una festa specialmente per i pi&ugrave; piccoli con esibizioni di validi artisti di strada, con clowneria, giocoleria e animazione che dalle 10 di mattina andr&agrave; avanti fino a notte.</span><br /><span>Una grande festa quindi che coniuga elementi diversi, dando vita ad eventi speciali e degustazioni. Un appuntamento goloso in un mix di cultura e sapori espressioni significative di questo magico evento.</span></p>','Festa del Cioccolato','2013-04-15 22:00:00','Centro storico dell\'Aquila','<ul>\r\n<li>test</li>\r\n<li>test</li>\r\n<li>test</li>\r\n</ul>'),(3,'<h3 align=\"justify\">Le pi&ugrave; importanti manifestazioni per festeggiare l\'arrivo della Befana, il giorno dell\' Epifania a l\'Aquila</h3>\r\n<p class=\"nst1\" align=\"justify\">Di seguito tutte le feste relative alla festa della Befana a&nbsp;<strong>l\'Aquila</strong>, le feste in piazza, in chiesa per celebrare la&nbsp;<em>festa dell\'Epifania</em>&nbsp;dedicata all\'arrivo dei Re Magi al cospetto di Ges&ugrave; Bambino, e per i non credenti all\'arrivo della Befana.<br /><br />La festa dell\'Epifania viene celebrata il 6 gennaio, e rappresenta il termine delle festivit&agrave; natalizie, e l\'ultimo giorno delle vacanze di Natale prima della riapertura delle scuole a&nbsp;<strong>l\'Aquila</strong>. L\'arrivo della si festeggia a&nbsp;<strong>l\'Aquila</strong>&nbsp;organizzando, viaggi, vacanze, last minute, weekend fuoriporta per tutta la famiglia, con grandi e bambini.<br /><br />A&nbsp;<strong>l\'Aquila</strong>, vi &egrave; comunque la tradizione di appendere le calze fuori dalla finestra in attesa che la notte tra il 5 ed il sei gennaio passi la befana a vccavallo della sua scopa a riempirle di dolci per i bimbi buoni e di carbone per i bimbi che sono stati monelli.</p>','Fiera dell\'epifania','2014-01-04 23:00:00','Centro storico dell\'Aquila','<ul>\r\n<li>test</li>\r\n<li>test</li>\r\n<li>test</li>\r\n</ul>');
/*!40000 ALTER TABLE `vp_eventi` ENABLE KEYS */;
